import React, { useState } from "react";
import { FiHome } from "react-icons/fi";

const tabs = [
  { label: "Home", icon: <FiHome className="mr-1" /> },
  { label: "Sales" },
  { label: "Inventory" },
  { label: "Catalog" },
];

export default function TopNavBar() {
  const [activeTab, setActiveTab] = useState("Sales");

  return (
    <nav className="bg-white border-b border-gray-200 px-6 pt-2 flex items-center gap-4">
      {tabs.map((tab) => (
        <button
          key={tab.label}
          className={`flex items-center text-lg font-semibold px-1 pb-2 border-b-2 transition
            ${
              activeTab === tab.label
                ? "border-green-600 text-green-700"
                : "border-transparent text-gray-900 hover:text-green-700"
            }`}
          onClick={() => setActiveTab(tab.label)}
        >
          {tab.icon}
          {tab.label}
        </button>
      ))}
    </nav>
  );
}
